import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f05d3ed8.js";const o={},c=t("<p>《三命通会》卷 八·六丁日乙巳时断</p><p>六丁日生时乙巳，伤官暗里会枭神；东方运地成虚秀，金水之乡禄贵人。</p><p>丁日乙巳时，丁以壬为官，乙为倒食，巳上壬绝，有明乙倒食，暗戊伤官健旺，为人傲物志高，平常。</p><p>若通金水月气，贵。</p><p>运通亦贵。</p><p>丁丑日乙巳时，春富，夏孤，秋吉，冬贵。</p><p>丁卯日乙巳时，春印，夏旺，秋财，冬官，看取用何如？俱可论吉。</p><p>午未年月，文章贵显，行官禄运，吉。</p><p>丁巳日乙巳时，再生巳月，倒冲，亥壬为官，无水填实破格者，主四五品贵。</p><p>丁未日乙巳时，若人倒冲格，无冲破，贵。</p><p>巳亥年月，三四品贵。</p><p>酉丑合财局，富。</p><p>丁酉日乙巳时，破财倒食，若通金水年月，行金水运，吉。</p><p>丁亥日乙巳时，时日并冲，忧伤妻子。</p><p>巳酉丑申子辰，金水二局，财官得用，以富贵论。</p><p>丁日巳时怕虎刑，财官运步始能通；好意人情反恶意，先难后易乐从容。</p><p>丁日时临乙巳，破财倒食难通。</p><p>双亲雁侣且和平，妻子无嗔无闷。</p><p>君子文学秀气，常人财艺通明。</p><p>壬庚辛癸若重逢，中末财名足用。</p>",20),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","208卷 八·六丁日乙巳时断.html.vue"]]);export{f as default};
